import React from 'react';

import './Footer.scss';

import iconAddFiles from './svg/addFile.svg';

const Footer = () => {
	return (
    <div className="wrapper-footer">
			<div className="wrapper-icon-add-file">
				<img 
					src={iconAddFiles} 
					className="icon-add-file" 
					alt="iconAddFiles"
				/>
			</div>

			<div className="wrapper-input-message">

			</div>
		</div>
	);
};

export default Footer;
